import React from 'react';
import Cards from './Cards';
import $Data from './$Data';
const Service = () =>{
    return <>
    <div className='m-5'>
    <h1 className='text-center'>Our Services</h1>
    </div>
    <div className='container-fluid mb-5'>
        
            

                
                    {$Data.map((val,ind)=>{
                        return(
                            <Cards 
                            key={ind}
                            imgsrc= {val.imgsrc}
                            title={val.title}/>
                        )
                    })
                    
}
                  
                </div>
    </>
}

export default Service;
